import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const [activeTab, setActiveTab] = useState('Home');

  const handleTabClick = (tabName) => {
    setActiveTab(tabName);
  };

  return (
    <nav className="navbar">
      <NavLink
        exact
        to="/"
        className={`navbar__tab ${activeTab === 'Home' ? 'active' : ''}`}
        onClick={() => handleTabClick('Home')}
      >
        Home
      </NavLink>
      <NavLink
        to="/add-to"
        className={`navbar__tab ${activeTab === 'Add-to' ? 'active' : ''}`}
        onClick={() => handleTabClick('Add-to')}
      >
        Add-to
      </NavLink>
      <NavLink
        to="/profile"
        className={`navbar__tab ${activeTab === 'Profile' ? 'active' : ''}`}
        onClick={() => handleTabClick('Profile')}
      >
        Profile
      </NavLink>
    </nav>
  );
}

export default Navbar;
